#coding = utf-8
from zhconv import convert
import jiphy
def Decode(scr):
    decode = convert(scr,'zh-hans')
    return decode
def PyToJs(scr):
    js = jiphy.to.python(scr)
    return js
def JsToPy(scr):
    py = jiphy.to.javascript(scr)
    return py
